import { getTicketsData } from "../actions"

export const fetchSearchId = () => {
  return dispatch => {
    fetch('https://aviasales-test-api.kata.academy/search')
      .then(response => response.json())
      .then(res => 
        fetch(`https://aviasales-test-api.kata.academy/search${res}`)
      )
      .then(data => data.json())
      .then(json => {
        console.log(json)
        dispatch(getTicketsData())
      })
  }
}
